window.bookSummaryJSON = "Learn the secret to making changes that stick! Every so often people get inspired (again!) to lose weight, to get organized, to start saving, or to stop worrying - but a few months later they give up, frustrated. It doesn't have to be that way. <p>In <i>This Year I Will...</i>, best-selling author M.J. Ryan offers breakthrough wisdom and coaching to help listeners make this time the time that change becomes permanent.</p> <p>Why do people find it so hard to change? The secret is that everyone has their own formula for making changes that stick, but most people don't know what theirs is. They think there is one way to lose five pounds, and another way to stay on top of their e-mail, but they don't realize that for all changes, there is one system that works best for each individual. </p> <p><i>This Year I Will...</i> helps you lock on to your unique formula for planning, implementing, and seeing a life change through, so you can use it again and again to tackle anything else you'd like to do.</p> <p>For anyone who has broken a New Year's resolution, fallen off a diet, or given up on fulfilling a dream, the ingenious strategies, inspiring stories, and sheer motivational energy of <i>This Year I Will...</i> will help you make a promise to yourself that you can actually keep.</p>"; 
